import classes from './Home.module.css'
import Card from 'react-bootstrap/Card'
import Button from 'react-bootstrap/Button'


const Home = () => {
  return (
    <Card className={classes.cardbody}>
      <Card.Img variant="top" src="holder.js/100px180" />
      <Card.Body>
        <Card.Title>About Me</Card.Title>
        <Card.Text>
          <p>Welcome to my demo page created with React and Bootstrap.</p>
          <p>This is just a simple CV page I did for fun and to practice basic React JS concepts.</p>
          <p>I started my journey as a web developer in 2019 and felt highly inclined towards FrontEnd
            development. </p>
          <p>I've always been passionate about the <b>UI/UX</b> we experience on a daily basis through Apps
            and webpages.</p>
          <p>I believe that high quality <b>UI/UX</b> can contribute to make our lives easier and bring joy while interacting with these tools.</p>
          <p>I hope I can achieve these goals in the FrontEnd world!</p>
        </Card.Text>
        <Button variant="primary">Study</Button>
        <Button variant="primary">Work</Button>
      </Card.Body>
    </Card >
  )
}

export default Home;


